import React, { Component } from 'react'
import pic from '../content/images/common/me2021.jpg'

export default class Grid extends Component {
	render()
	{
		return (
			<header id="header">
			<div class="inner">

			<a href="/" class="logo">
			<span class="symbol"><img src={pic} alt="" /></span><span class="title">Sebastian S. Rodriguez</span>
			</a>

			</div>
			</header>
		)
	}
}
